import React from 'react';

function Header() {
  return (
    <header>
      <div className="logo">
        <h1>My Website</h1>
      </div>
      <nav>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/Login">Log in</a></li>
          <li><a href="/Menu">Menu</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
